import os
import sys

#
# Complete the pageCount function below.
#
def pageCount(n, p):
    #
    # Write your code here.
    if n%2==1:
        return(min(p//2,(n-p)//2))
    else: return(min(p//2,(n-p+1)//2))

if __name__ == '__main__':
