# Complete the hourglassSum function below.
def hourglassSum(arr):
    for i in range(4):
        for j in range(4):
            if not i and not j:
                maxsum=arr[i][j]+arr[i][j+1]+arr[i][j+2]+arr[i+1][j+1]+arr[i+2][j]+arr[i+2][j+1]+arr[i+2][j+2]
            else:
                maxsum=max(maxsum,arr[i][j]+arr[i][j+1]+arr[i][j+2]+arr[i+1][j+1]+arr[i+2][j]+arr[i+2][j+1]+arr[i+2][j+2])
    return maxsum


